import React from 'react';
import Link from 'react-router-dom';

function NavBar()
{
    return(
        <NavBar>
            <ul className="nav-links">
                <Link to='/'>
                    <li>Main</li>
                </Link>
                <Link to='/login'>
                    <li>Login</li>
                </Link>
            </ul>
        </NavBar>
    );
}

export default NavBar;
